        protected override void Process(DPFP.Sample Sample)
        {
            base.Process(Sample);

            // Process the sample and create a feature set for the enrollment purpose.
            DPFP.FeatureSet features = ExtractFeatures(Sample, DPFP.Processing.DataPurpose.Enrollment);

            // Check quality of the sample and add to enroller if it's good
            if (features != null) try
                {
                    MakeReport("Se creó el conjunto de funciones de huellas dactilares. 1");
                    //MakeReport("The fingerprint feature set was created1.");
                    Enroller.AddFeatures(features);     // Add feature set to template.
                }
                finally
                {
                    UpdatePen();
                    UpdateStatus();

                    // Check if template has been created.
                    switch (Enroller.TemplateStatus)
                    {
                        case DPFP.Processing.Enrollment.Status.Ready:   // report success and stop capturing
                            OnTemplate(Enroller.Template);
                            SetPrompt("Haga clic en Cerrar y luego haga clic en Verificación de huellas digitales.");
                            //SetPrompt("Click Close, and then click Fingerprint Verification.");
                            Stop();
                            break;

                        case DPFP.Processing.Enrollment.Status.Failed:  // report failure and restart capturing
                            Enroller.Clear();
                            Stop();
                            UpdatePen();
                            UpdateStatus();
                            OnTemplate(null);
                            Start();
                            break;
                    }
                }
        }

        private void UpdateStatus()
        {
            // Show number of samples needed.
            SetStatus(String.Format("Se necesitan muestras de huellas dactilares: {0}", Enroller.FeaturesNeeded));
            //SetStatus(String.Format("Fingerprint samples needed: {0}", Enroller.FeaturesNeeded));
        }

        public CapturarHuella()
        {
            InitializeComponent();

            labelPen.Left = (this.ClientSize.Width - labelPen.Width) / 2;
            labelInfo.Left = (this.ClientSize.Width - labelInfo.Width) / 2; ;
        }

        private void UpdatePen()
        {
            if (this.InvokeRequired)
            {
                // Invoca la llamada en el hilo de la UI
                this.Invoke((MethodInvoker)delegate
                {
                    UpdatePen();
                });
            }
            else
            {
                labelPen.Text = "Pendiente(s): " + Enroller.FeaturesNeeded;
            }
        }
    }
